import React from 'react'
const Product = ({name,description,img,price}) => {
    return (
        <div className='product-card'>
            <img className='product-bmx-image' src={img} alt="" />
            <h1>{name}</h1>
            <p>{description}</p>
            <span>{price}</span>
            <button>Купить</button>
        </div>
    )
}

export default Product
